import PropTypes from "prop-types";
import {
  getAuthorization,
  getClientCredentials,
} from "../../services/APIs/AuthAPI/AuthAPI";

const Auth = ({ setAuthData }) => {
  const handleLogin = () => {
    try {
      async function fetchData() {
        const creds = await getClientCredentials();
        console.log(creds);
        await getAuthorization(creds.client_id, creds.client_secret);
      }
      fetchData();
    } catch {
      console.error("failed");
    }
    // const data = {};
    // setAuthData(data);
  };
  return <div onClick={() => handleLogin()}>Login</div>;
};

Auth.defaultProps = {
  setAuthData: () => {},
};

Auth.propTypes = {
  setAuthData: PropTypes.func,
};

export default Auth;
